import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

import Home from './components/Home';
import Preferencia from './components/Preferencia';
import Comida from './components/Comida';
import Animal from './components/Animal';
import Manchete from './components/Manchete';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="app">
        <BrowserRouter>
        <Route exact path="/" component={ Home }></Route>
        <Route exact path="/preferencia" component={ Preferencia }></Route>
        <Route exact path="/comida" component={ Comida }></Route>
        <Route exact path="/animal" component={ Animal }></Route>
        <Route exact path="/manchete" component={ Manchete }></Route>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
